<!DOCTYPE HTML>
<html>
<head>
<title>Compiler</title>
<meta name="viewport" content="width=device-width,initial-scale=1.0">
</head>
<body>
<script>
"use strict";
try{
var x=decodeURIComponent(document.URL);
eval(x.substr(x.indexOf("=")+1,x.length));
}catch(e){
document.write(e);
}
</script>
</body>
</html>
